import React from "react";

export class RegistrationPage extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            inputValue: ''
        };
    }

    render(){
        return(
            <div className="pagestage">
                <input 
                    type="text" 
                    value={this.state.inputValue} 
                    onChange={(evt)=>this.handleOnCHange(evt)}
                />
                <button onClick={(evt)=>this.handleIsInvitedByPhone()}>Registration</button>
            </div>
        )
    }

    handleOnCHange(evt){
        const value = evt.target.value;
        this.setState({
            inputValue: value,
            isInvitedByPhone: false
        });
    }
    handleIsInvitedByPhone(){
        const phoneNumber = this.state.inputValue;
        console.log('Input bar value: ' + phoneNumber);
        const jsonData = {
            'phonenumber': phoneNumber
        };
        
        console.log('clicked handleclick inside apps');
        console.log('object: ' + jsonData.phonenumber);
        
        const requestOptions = {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(jsonData)
        };
        fetch('http://localhost:3001/phonenumber', requestOptions)
        .then(response => response.json())
        .then(data =>console.log('data: ' + data.responded));

        this.reset();
    }

    reset() {
        this.setState({
            inputValue: ''
        })
    }
}
